public class M1283 {
    public int smallestDivisor(int[] nums, int threshold) {
        int l = 1;
        int r = 10000000;
        while (l < r) {
            int mid = l + ((r - l) >> 1);
            int count = 0;
            for (int i = 0; i < nums.length; i++) {
                count += (nums[i] + mid - 1) / mid;
            }
            if (count > threshold) {
                l = mid + 1;
            } else {
                r = mid;
            }
        }
        return l;
    }
}
